import streamlit as st
import pickle
import random
import warnings
warnings.filterwarnings('ignore')
classifier=pickle.load(open("model.pkl","rb"))
def pred(u,g,r,i,z,redshift):
    predicted_class=classifier.predict([[u,g,r,i,z,redshift]])
    return predicted_class


st.set_page_config(layout='wide')

st.markdown(
    body="<h3 style='text-align: center;'>Stellar Classification</h3>",
    unsafe_allow_html=True
)

col1, col2 = st.columns([1, 2])

with col1:
    u = st.slider(label='Ultraviolet', min_value=0.0,max_value=30.0, value=22.0)
    g = st.slider(label='Green', min_value=0.0, max_value=30.0, value=22.0)
    r = st.slider(label='Red', min_value=0.0, max_value=30.0, value=25.0)
    i = st.slider(label='Infrared (I)', min_value=0.0,
                  max_value=30.0, value=10.0)
    z = st.slider(label='Infrared (Z)', min_value=0.0,
                  max_value=30.0, value=5.0)
    redshift = st.slider(label='Redshift', min_value=0.0,
                         max_value=10.0, value=2.0)

with col2:
    if st.button("Predict"):
        result=pred(u,g,r,i,z,redshift)
